    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Deep Fork NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Deep Fork NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, legal mandates, the long-range management strategy, goals and objectives,
    and management action plan synthesis by fiscal year. Key planning issues include:
    climate, hydrology, soils, vegetation, wildlife, air quality, and cultural resources.",nt"owner_org":
